import React, { useEffect } from "react";
import {
	ImageBackground,
	StyleSheet,
	Text,
	View,
	Image,
	Dimensions,
} from "react-native";
import BG from '../assets/images/download.jpg'
import Waves from '../assets/images/wave.svg'
import BG2 from '../assets/images/bg.png' 
navigation.setOptions({ headerShown: false });


const Splash =(props) => {
  
  useEffect(() => {
    setTimeout(() => {
      props.navigation.navigate("Login");
    }, 3000);
    
  
    
  }, [])
  

  
    return (
			<>
				
				<View style={styles.container}>
					<View resizeMode="cover" source={BG} style={styles.image}>
						<Text style={styles.text}>Welcome To</Text>
						<Text style={styles.text}>Car Lift</Text>
						<Image
							source={BG2}
							style={{ width: 350, height: 350, marginStart: 20 }}
						/>
					</View>
				</View>
			</>
		);
  }
  const android = Dimensions.get("window");
  const styles = StyleSheet.create({
		container: {
			flex: 1,
			width:android.width1*1.5,
			height:android.height*1.5,
		},
		image: {
			flex: 1,
			backgroundColor: "#1F4690",
			justifyContent: "center",
		},
		text: {
			color: "white",
			fontSize: 42,
			lineHeight: 84,
			fontWeight: "bold",
			textAlign: "center",
			
		},
    bg:{
      width:android.width,
      
    }
	});


export default Splash;
